  \"2016-03-17T20:52:24.121713\",\n\t\"name\": \"state-of-iowa-revenue\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides information on state
  revenue for fiscal years starting July 1, 2011 through the current fiscal year,
  year to date, from the state's centralized accounting system.  The revenue are summarized
  by Fiscal Year, Month, Fund, Appropriation, Department, Unit, and Revenue Class.
  The state fiscal year runs from July 1 to the following June 30 and is numbered
  for the calendar year in which it ends. The State of Iowa operates on a modified
  accrual basis which provides that encumbrances on June 30 must be paid within 60
  days after year end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
